 And user clicks on Edges menu\r\n    Then provisioned list of edges displayed\r\n    Examples:\r\n     | user |\r\n     | Admin | \r\n\r\n@Edges_06\r\nScenario Outline: edge out of service\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed\r\n    When click on the edge which is to do Out-Of-Service<SheetName>, <RowNumber>\r\n    Then Edge details page is displayed\r\n    When user clicks on out of service button\r\n    And out of service warning message is displayed\r\n    And click on confirm button\r\n    Then edge is in out-of-service status\r\n    Examples:\r\n    | user | SheetName | RowNumber | \r\n    | Admin | Edges | 0 |\r\n    \r\n    \r\n@Edges_07\r\nScenario Outline: edge in service\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed\r\n    When click on edge which is to do IN-Service<SheetName>, <RowNumber>\r\n    Then Edge details page is displayed\r\n    When user clicks on in service button\r\n    And in service warning message is displayed\r\n    And click on confirm button\r\n    Then edge in In-service status\r\n    Examples:\r\n    | user | SheetName | RowNumber | \r\n    | Admin | Edges | 0 |\r\n    \r\n  \r\n@Edges_08\r\nScenario Outline: changing edge status to onboard to faulty and vice-versa by changing threshold values\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed observe status of edge\r\n    When user clicks on system configuration menu\r\n    Then system configuration page is displayed\r\n    When user clicks on threshold settings option\r\n    Then threshold settings page is displayed\r\n    When user changes details for change config<SheetName>, <RowNumber>\r\n    And click on submit button for system config\r\n    And system c \tWhen user enters the details to create artifact <service>, <artifactname>, <componentId>, <componenetImageName>\r\n \t\tThen user submits the details and able to see successful message\r\n \t\tWhen user clicks on select artifact\r\n \t\tThen user able to see created artifact\r\n\tExamples:\r\n\t\t| user | SheetName | RowNumber |\r\n    | Admin | MyApplication | 0 |\r\n    #| Dev | MyApplication | 1 |\r\n    \r\n\r\n@MyApplication_02\r\nScenario Outline: user able to delete artifact\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on my application\r\n \t\tThen user is on my application page \r\n \t\tWhen user clicks on new application\r\n \t\tThen user is on new application page\r\n \t\tWhen user selects from where to artifact is to delete<SheetName>, <RowNumber> \r\n \t\tThen user is able to see that service <service>\t\r\n\t\tWhen user clicks on select artifact\r\n \t\tThen user able to see artifacts uploaded\r\n \t\tWhen user selects the artifactid for delete\r\n \t\tAnd user clicks on delete button\r\n \t\tThen user is not able to find the deleted artifactId\r\n \t\tExamples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | MyApplication | 0 |\r\n    \r\n    \r\n    \r\n\r\n@MyApplication_03\r\nScenario Outline: user able to onboard application\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on my application\r\n \t\tThen user is on my application page \r\n \t\tWhen user clicks on new application\r\n \t\tThen user is on new application page\t\r\n\t\tWhen user selects where to onboard application<SheetName>, <RowNumber>\r\n\t\tThen user is able to see that service <service>\r\n \t\tWhen click on import button\r\n \t\tThen upload file page is displayed\r\n \t\tWhen upload the yaml file of application\r\n \t\tAnd click on submit button\r\n \t\tThen user is able to see uploaded data on page\r\n \t\tWhen user clicks on select artifact\r\n \t  page is displayed\r\n \t\tWhen user clicks on add new user\r\n \t\tThen add new user page is displayed\r\n \t\tWhen user enter the details of new user<SheetName>, <RowNumber>\r\n \t\tAnd clicks on the submit\r\n \t\tThen created user is displayed\r\n \t\tWhen user logs out\r\n \t\tThen login page is displayed\r\n \t\tWhen user enter username as <username>, password as <pass> and domain as <domainName>\r\n \t\tAnd click on login\r\n \t\tThen user is able to login \r\n \t\tExamples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n    | Admin | UserManagement | 1 |\r\n    | Admin | UserManagement | 2 |\r\n    | Admin | UserManagement | 3 |\r\n    \t\r\n@UserManagement_02 \t\t\t\r\nScenario Outline: Developer is not able to create new user\r\n\tWhen user logs into MEC portal<user>\r\n\tAnd user is on dashboard page\r\n\tThen user verifies user management menu is not present for developer\r\n\tExamples:\r\n\t| user |\r\n\t| Developer |\r\n \t\t\r\n \t\t\r\n@UserManagement_03\t\t\r\n Scenario Outline: user is able to delete user\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the delete button\r\n \t\tThen user sees popup of confirmation page\r\n \t\tWhen clicks on confirm button\r\n \t\tThen user details are removed\r\n \t\tExamples:\r\n\t\t| user |\r\n\t\t| Admin |\r\n\t\t\r\n@UserManagement_04\r\n\tScenario Outline: Admin is able to inactive the user\r\n\t\tWhen user logs into MEC portal<user>\r\n\t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the lock button\r\n \t\tThen user is inactivated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tThen user enters the credientials of inactive user and not able to login\r\n \t\tExamples:\r\n \t\t| user |\r\n\t\t| Admin |\r\n\t\r\n@UserManagement_05\t\t\r\nScenario Outline: Admin is able to active the user\r\n\t\tWhen user logs into MEC portal<user>\r\n\t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on open lock button\r\n \t\tThen user is activated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tAnd user enters the credientials of activated user and able to login\r\n \t\tThen user is on the dashboard page as user activated\r\n \t\tExamples:\r\n \t\t| user |\r\n\t\t| Admin |\r\n \t\t\r\n@UserManagement_06 \t\t\r\nScenario Outline: User Management complete end to end scenario\r\n\t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on add new user\r\n \t\tThen add new user page is displayed\r\n \t\tWhen user enter the details of new user<SheetName>, <RowNumber>\r\n \t\tAnd clicks on the submit\r\n \t\tThen created user is displayed\r\n \t\tWhen user logs out\r\n \t\tThen login page is displayed\r\n \t\tWhen user enter username as <username>, password as <pass> and domain as <domainName>\r\n \t\tAnd click on login\r\n \t\tAnd user is on Dashboard page\r\n \t\tThen user is admin or dev verify\r\n \t\tWhen user clicks on User Mangement Menu for UM\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the delete button\r\n \t\tThen user sees popup of confirmation page\r\n \t\tWhen clicks on confirm button\r\n \t\tThen user details are removed\r\n \t\tWhen user clicks on the lock button\r\n \t\tThen user is inactivated\r\n \t\tWhen user clicks on open lock button\r\n \t\tThen user is activated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tAnd user enters the credientials of activated user and able to login\r\n \t\tThen user is on the dashboard page as user activated\r\n \t\t Examples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n    #| Admin | UserManagement | 1 |\r\n    #| Admin | UserManagement | 2 |\r\n    #| Admin | UserManagement | 3 |\r\n    \r\n \r\n@UserManagement_07\r\nScenario Outline: user able to edit user and update user\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on edit button for user to be edit<SheetName>, <RowNumber>\r\n \t\tThen update user page is dispalyed\r\n \t\tWhen update the details for user which is to be required\r\n \t\tAnd Click on update button\r\n \t\tThen user is able to see the updated user successfully popup message\r\n \t\tExamples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n \t\t\r\n  \r\n\r\n\r\n \t\t\r\n \t\t  \r\n \t\t","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/APATHRUT/OneDrive%20-%20Capgemini/Desktop/E2CO%20PROJECT/Automation/E2COAutomation/E2CO%2520Automation/src/test/resources/Features/WebUITests/E2COTests_UserManagement.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@UserManagement","id":"c7d4c54c-9abe-44cb-b31d-d4aacd196f2b"}],"language":"en","keyword":"Feature","name":"User Management Feature","description":"","children":[{"scenario":{"location":{"line":6,"column":2},"tags":[{"location":{"line":5,"column":1},"name":"@UserManagement_01","id":"5329f6cc-571c-4634-81dc-9c5ab38aaead"}],"keyword":"Scenario Outline","name":"Create new user and verify login","description":"","steps":[{"location":{"line":7,"column":4},"keyword":"When ","text":"user logs into MEC portal<user>","id":"f91f67c6-eabf-4902-981f-74343f6b0737"},{"location":{"line":8,"column":4},"keyword":"And ","text":"user is on Dashboard page","id":"ac4e0d5b-d3ad-4fbb-be87-f6c956386441"},{"locati
